public boolean equals(Object obj) {
  if (this == obj) {
    return true;
  }
  if (!(obj instanceof TimelineEventSubDoc)) {
    return false;
  }
  TimelineEventSubDoc otherTimelineEvent = (TimelineEventSubDoc) obj;
  return this.timelineEvent.getId().equals(otherTimelineEvent.getId());
}
